import Home from "./components/Home";
import PageError from "./components/PageError";
import Buns from "./components/Buns";


const App = [
  {
    path: '/',
    children: [
      {
        path: '/',
        exact: true,
        element: < Home/>,
        errorElement: < PageError/>,
        children: [
          {
            path: '/buns',
            element: <Buns/>
          }
        ]
      }

    ]
  }
]
export default App;
